{"metadata":{"kernelspec":{"name":"ir","display_name":"R","language":"R"},"language_info":{"name":"R","codemirror_mode":"r","pygments_lexer":"r","mimetype":"text/x-r-source","file_extension":".r","version":"4.4.0"},"kaggle":{"accelerator":"none","dataSources":[{"sourceId":9915119,"sourceType":"datasetVersion","datasetId":6092874}],"dockerImageVersionId":30749,"isInternetEnabled":true,"language":"r","sourceType":"notebook","isGpuEnabled":false}},"nbformat_minor":4,"nbformat":4,"cells":[{"source":"<a href=\"https://www.kaggle.com/code/adityatakle257/bikeshare-analysis?scriptVersionId=213361401\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","source":"# Background\n\nIn 2016, Cyclistic launched a successful bike-share offering. Since then, the program has grown\nto a fleet of 5,824 bicycles that are geotracked and locked into a network of 692 stations\nacross Chicago. The bikes can be unlocked from one station and returned to any other station\nin the system anytime.\n\nI am a junior data analyst working on the marketing analyst team at a fictional company Cyclistic, a bike-share company in Chicago. \nI have been tasked to do analysis on comapany's bikeshare data to find insights and present them to the stakeholders. ","metadata":{}},{"cell_type":"markdown","source":"# Ask Phase\n\nQuestion I am trying to find insights about:\n\n- How do annual members and casual riders use Cyclistic bikes differently?\n\nStakeholders of the insights from the data :\n\n- Lily Moreno : Director of marketing and my manager. Responsible for development of campaigns and initiatives to promote the bike-share program.\n\nExpectations after the analysis:\n\n1. A clear statement of the business task\n2. A description of all data sources used\n3. Documentation of any cleaning or manipulation of data\n4. A summary of your analysis\n5. Supporting visualizations and key findings\n6. Top three recommendations based on analysis\n\nFurther effects of the insights:\n\n- Insights from this analysis will help company to make decisions on how to develop more effective campaigns by getting the insights about the customers.\n\n\n","metadata":{}},{"cell_type":"markdown","source":"# Prepare Phase\n\nData is located at https://divvy-tripdata.s3.amazonaws.com/index.html\n\nData is organised based on separate files monthwise and quarterwise.\nData is credible at a larger extend as its provided by Google.\n\nFor this analysis, I have selected 10 months of data from January 2024 to October 2024.","metadata":{}},{"cell_type":"code","source":"# This R environment comes with many helpful analytics packages installed\n# It is defined by the kaggle/rstats Docker image: https://github.com/kaggle/docker-rstats\n# For example, here's a helpful package to load\n\nlibrary(tidyverse) # metapackage of all tidyverse packages\nlibrary(ggplot2)\n\n# Input data files are available in the read-only \"../input/\" directory\n# For example, running this (by clicking run or pressing Shift+Enter) will list all files under the input directory\n\nlist.files(path = \"../input\")\n\n# You can write up to 20GB to the current directory (/kaggle/working/) that gets preserved as output when you create a version using \"Save & Run All\" \n# You can also write temporary files to /kaggle/temp/, but they won't be saved outside of the current session","metadata":{"execution":{"iopub.status.busy":"2024-12-16T14:07:10.63064Z","iopub.execute_input":"2024-12-16T14:07:10.632075Z","iopub.status.idle":"2024-12-16T14:07:10.652823Z","shell.execute_reply":"2024-12-16T14:07:10.651051Z"},"trusted":true},"outputs":[{"output_type":"display_data","data":{"text/html":"'google-capestone-project-1-bikeshare-dataset'","text/markdown":"'google-capestone-project-1-bikeshare-dataset'","text/latex":"'google-capestone-project-1-bikeshare-dataset'","text/plain":"[1] \"google-