member riders and how many by casual riders.\nrider <- data |>\ngroup_by(member_casual) |>\nsummarize(count = n())  \n\n# Made a column for percentage of rider types\nrider$percent <- as.factor(round(rider$count / sum(rider$count) * 100, 1))\n\n\n# pie chart for total data.\nrider_pie <- ggplot(rider,\n       aes(x = \"\", y = count, fill = percent)) +\n    geom_bar(stat = \"identity\", \n             show.legend = FALSE) +\n    coord_polar(\"y\") +\n    theme_void() +\n    geom_text(\n        aes(label = paste0(percent, \"%\", \"\\n\", member_casual)),\n              position = position_stack(vjust = 0.5)) +\n    labs(title = \"Rider type percentage\")\n\nrider\nsave(rider, file = \"/kaggle/working/rider.RData\")","metadata":{"execution":{"iopub.status.busy":"2024-12-16T14:05:36.866732Z","iopub.execute_input":"2024-12-16T14:05:36.868204Z","iopub.status.idle":"2024-12-16T14:05:36.999532Z","shell.execute_reply":"2024-12-16T14:05:36.997716Z"},"trusted":true},"outputs":[{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A tibble: 2 × 3</caption>\n<thead>\n\t<tr><th scope=col>member_casual</th><th scope=col>count</th><th scope=col>percent</th></tr>\n\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;int&gt;</th><th scope=col>&lt;fct&gt;</th></tr>\n</thead>\n<tbody>\n\t<tr><td>casual</td><td>2048807</td><td>36.9</td></tr>\n\t<tr><td>member</td><td>3504947</td><td>63.1</td></tr>\n</tbody>\n</table>\n","text/markdown":"\nA tibble: 2 × 3\n\n| member_casual &lt;chr&gt; | count &lt;int&gt; | percent &lt;fct&gt; |\n|---|---|---|\n| casual | 2048807 | 36.9 |\n| member | 3504947 | 63.1 |\n\n","text/latex":"A tibble: 2 × 3\n\\begin{tabular}{lll}\n member\\_casual & count & percent\\\\\n <chr> & <int> & <fct>\\\\\n\\hline\n\t casual & 2048807 & 36.9\\\\\n\t member & 3504947 & 63.1\\\\\n\\end{tabular}\n","text/plain":"  member_casual count   percent\n1 casual        2048807 36.9   \n2 member        3504947 63.1   "},"metadata":{}}],"executio