des taken sorted by day of week - member data\nmember_rides_week_sorted <- member_data |>\ngroup_by(start_day) |>\nsummarize(ride_count = n()) |>\nmutate(ride_count_percent = round((ride_count / sum(ride_count)) * 100, 1))\n\n# number of rides taken sorted by day of week - casual data\ncasual_rides_week_sorted <- casual_data |>\ngroup_by(start_day) |>\nsummarize(ride_count = n()) |>\nmutate(ride_count_percent = round((ride_count / sum(ride_count)) * 100, 1))\n\n# Adding ride_count column from member_rides_week_sorted and casual_rides_week_sorted to total_rides_week_sorted for making plotting graph.\ntotal_rides_week_sorted$ride_count_member <- member_rides_week_sorted$ride_count\ntotal_rides_week_sorted$ride_count_casual <- casual_rides_week_sorted$ride_count\n\n# changing data type of start_day to keep the it in ordered way while plotting graph.\ntotal_rides_week_sorted <- total_rides_week_sorted  %>%\n  mutate(\n      start_day = factor(\n          start_day, \n          levels = c(\"Monday\", \"Tuesday\", \"Wednesday\", \"Thursday\", \"Friday\", \"Saturday\", \"Sunday\")\n      )\n  )\n\n\ntotal_rides_week_sorted\nmember_rides_week_sorted\ncasual_rides_week_sorted\nsave(total_rides_week_sorted, file = \"/kaggle/working/total_rides_week_sorted.RData\")\nsave(member_rides_week_sorted, file = \"/kaggle/working/member_rides_week_sorted.RData\")\nsave(casual_rides_week_sorted, file = \"/kaggle/working/casual_rides_week_sorted.RData\")","metadata":{"execution":{"iopub.status.busy":"2024-12-16T14:06:51.044749Z","iopub.execute_input":"2024-12-16T14:06:51.046217Z","iopub.status.idle":"2024-12-16T14:06:51.313213Z","shell.execute_reply":"2024-12-16T14:06:51.311311Z"},"trusted":true},"outputs":[{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A tibble: 7 × 4</caption>\n<thead>\n\t<tr><th scope=col>start_day</th><th scope=col>ride_count</th><th scope=col>ride_count_member</th><th scope=col>ride_count_casual</th></tr>\n\t<tr><th scope=co