h ). The variance in count of ride length follows the pattern of standard deviation (36.65 mins for members and 91.22 mins for casual riders).","metadata":{}},{"cell_type":"markdown","source":"# Act Phase","metadata":{}},{"cell_type":"markdown","source":"Recommendations based on analysis:\n1. Create targetted campaigns for weekends and long length rides.\n2. Discounts for early morning rides and off peak hour rides.\n3. Campaigns for winter months like providing discounted winter gear rentals.\n4. Promoting the use of electric bikes for long rides by increasing the charge stations and discountings.\n5. Special discounts and campaigns during off peak months for long rides.\n6. Loyalty points for regular use of bikes for members.\n7. Allocating more classic bikes on weekends on popular stations and electric bikes during weekdays.\n8. Offer group or family discounts for weekends for members so the casual riders can consider getting membership.\n","metadata":{}}]}